public class p122_2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int month = Integer.parseInt(args[0]);
		
		switch (month) {
		case 2:;
		case 3:;
		case 4:
			System.out.println("Spring!");
			break;
		case 5:;
		case 6:;
		case 7:
			System.out.println("Summer!");
			break;
		case 8:;
		case 9:;
		case 10:
			System.out.println("Autumn!");
			break;
		case 11:;
		case 12:;
		case 1:
			System.out.println("Winter!");
			break;
		}
	}

}
